package com.class5;

public class NestedIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=23;
		int num2=24;
		
		if (num1>num2) {
			System.out.println("Num1 is larger than num2");
		}else {
			System.out.println("Num1 is smaller than num2");
		}
	}

}
